func testPlayerToManyTiles(t *testing.T) {
	var err error
	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Player
	var b, c Tile

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, playerDBTypes, true, playerColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Player struct: %s", err)
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}

	randomize.Struct(seed, &b, tileDBTypes, false, tileColumnsWithDefault...)
	randomize.Struct(seed, &c, tileDBTypes, false, tileColumnsWithDefault...)

	b.PlayerID.Valid = true
	c.PlayerID.Valid = true
	b.PlayerID.Int = a.ID
	c.PlayerID.Int = a.ID
	if err = b.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(tx); err != nil {
		t.Fatal(err)
	}

	tile, err := a.Tiles(tx).All()
	if err != nil {
		t.Fatal(err)
	}

	bFound, cFound := false, false
	for _, v := range tile {
		if v.PlayerID.Int == b.PlayerID.Int {
			bFound = true
		}
		if v.PlayerID.Int == c.PlayerID.Int {
			cFound = true
		}
	}

	if !bFound {
		t.Error("expected to find b")
	}
	if !cFound {
		t.Error("expected to find c")
	}

	slice := PlayerSlice{&a}
	if err = a.L.LoadTiles(tx, false, (*[]*Player)(&slice)); err != nil {
		t.Fatal(err)
	}
	if got := len(a.R.Tiles); got != 2 {
		t.Error("number of eager loaded records wrong, got:", got)
	}

	a.R.Tiles = nil
	if err = a.L.LoadTiles(tx, true, &a); err != nil {
		t.Fatal(err)
	}
	if got := len(a.R.Tiles); got != 2 {
		t.Error("number of eager loaded records wrong, got:", got)
	}

	if t.Failed() {
		t.Logf("%#v", tile)
	}
}

func testPlayerToManyAddOpTiles(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Player
	var b, c, d, e Tile

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, playerDBTypes, false, strmangle.SetComplement(playerPrimaryKeyColumns, playerColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Tile{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, tileDBTypes, false, strmangle.SetComplement(tilePrimaryKeyColumns, tileColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(tx); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*Tile{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddTiles(tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if a.ID != first.PlayerID.Int {
			t.Error("foreign key was wrong value", a.ID, first.PlayerID.Int)
		}
		if a.ID != second.PlayerID.Int {
			t.Error("foreign key was wrong value", a.ID, second.PlayerID.Int)
		}

		if first.R.Player != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Player != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.Tiles[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.Tiles[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.Tiles(tx).Count()
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

