func testPlayerToManyRemoveOpTiles(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Player
	var b, c, d, e Tile

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, playerDBTypes, false, strmangle.SetComplement(playerPrimaryKeyColumns, playerColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*Tile{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, tileDBTypes, false, strmangle.SetComplement(tilePrimaryKeyColumns, tileColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}

	err = a.AddTiles(tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.Tiles(tx).Count()
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveTiles(tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.Tiles(tx).Count()
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if b.PlayerID.Valid {
		t.Error("want b's foreign key value to be nil")
	}
	if c.PlayerID.Valid {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.Player != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.Player != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.Player != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.Player != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.Tiles) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.Tiles[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.Tiles[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

