func testPlayerToOneSetOpRoomUsingRoom(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Player
	var b, c Room

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, playerDBTypes, false, strmangle.SetComplement(playerPrimaryKeyColumns, playerColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, roomDBTypes, false, strmangle.SetComplement(roomPrimaryKeyColumns, roomColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &c, roomDBTypes, false, strmangle.SetComplement(roomPrimaryKeyColumns, roomColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err := a.Insert(tx); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(tx); err != nil {
		t.Fatal(err)
	}

	for i, x := range []*Room{&b, &c} {
		err = a.SetRoom(tx, i != 0, x)
		if err != nil {
			t.Fatal(err)
		}

		if a.R.Room != x {
			t.Error("relationship struct not set to correct value")
		}

		if x.R.Players[0] != &a {
			t.Error("failed to append to foreign relationship struct")
		}
		if a.RoomID.Int != x.ID {
			t.Error("foreign key was wrong value", a.RoomID.Int)
		}

		zero := reflect.Zero(reflect.TypeOf(a.RoomID.Int))
		reflect.Indirect(reflect.ValueOf(&a.RoomID.Int)).Set(zero)

		if err = a.Reload(tx); err != nil {
			t.Fatal("failed to reload", err)
		}

		if a.RoomID.Int != x.ID {
			t.Error("foreign key was wrong value", a.RoomID.Int, x.ID)
		}
	}
}

func testPlayerToOneRemoveOpRoomUsingRoom(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer tx.Rollback()

	var a Player
	var b Room

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, playerDBTypes, false, strmangle.SetComplement(playerPrimaryKeyColumns, playerColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	if err = randomize.Struct(seed, &b, roomDBTypes, false, strmangle.SetComplement(roomPrimaryKeyColumns, roomColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}

	if err = a.Insert(tx); err != nil {
		t.Fatal(err)
	}

	if err = a.SetRoom(tx, true, &b); err != nil {
		t.Fatal(err)
	}

	if err = a.RemoveRoom(tx, &b); err != nil {
		t.Error("failed to remove relationship")
	}

	count, err := a.Room(tx).Count()
	if err != nil {
		t.Error(err)
	}
	if count != 0 {
		t.Error("want no relationships remaining")
	}

	if a.R.Room != nil {
		t.Error("R struct entry should be nil")
	}

	if a.RoomID.Valid {
		t.Error("foreign key value should be nil")
	}

	if len(b.R.Players) != 0 {
		t.Error("failed to remove a from b's relationships")
	}
}

